            +gen.var_number+"',"
            +gen.tin_telephonType_id_FK+","
            +gen.int_country_id_FK +")");
            big_telephon_id_PK++;
        } catch (error) {
            console.log(error)
        }
        
    }
    
    pool.close;
    res() 
};





